import React, { Component } from "react";

class Question extends Component {
  constructor(props) {
    super(props);
    this.state = {
      question_id: props.match.params.question_id
    };
  }
  render() {
    console.log(this.state.match.params.question_id);
    return <div>{null}</div>;
  }
}

export default Question;
